CREATE DATABASE DATAMART;

USE DATAMART;

SET character_set_connection=utf8;
SET character_set_client=utf8;
SET character_set_results=utf8;


-- -----------------------------------------------------
-- Table DIM_CUSTOMER
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS DIM_CUSTOMER (
  SK_CUSTOMER INT NOT NULL AUTO_INCREMENT,
  ID_CUSTOMER INT NOT NULL,
  FIRST_NAME VARCHAR(60) NOT NULL,
  LAST_NAME VARCHAR(60) NOT NULL,
  EMAIL VARCHAR(100) NOT NULL,
  GENDER VARCHAR(25) NOT NULL,
  STATE VARCHAR(100) NOT NULL,
  CITY VARCHAR(100) NOT NULL,
  PRIMARY KEY (SK_CUSTOMER))
ENGINE = InnoDB DEFAULT CHARSET=utf8;


-- -----------------------------------------------------
-- Table DIM_BRAND
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS DIM_BRAND (
  SK_BRAND INT NOT NULL,
  ID_BRAND INT NOT NULL,
  NAME VARCHAR(100) NOT NULL,
  PRIMARY KEY (SK_BRAND))
ENGINE = InnoDB DEFAULT CHARSET=utf8;


-- -----------------------------------------------------
-- Table DIM_CAR
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS DIM_CAR (
  SK_CAR INT NOT NULL,
  ID_CAR INT NOT NULL,
  MODEL VARCHAR(100) NOT NULL,
  YEAR INT NOT NULL,
  PRICE DECIMAL(10,2) NOT NULL,
  PRIMARY KEY (SK_CAR))
ENGINE = InnoDB DEFAULT CHARSET=utf8;


-- -----------------------------------------------------
-- Table DIM_VENDER
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS DIM_VENDER (
  SK_VENDER INT NOT NULL,
  ID_VENDER INT NOT NULL,
  NAME VARCHAR(60) NOT NULL,
  PRIMARY KEY (SK_VENDER))
ENGINE = InnoDB DEFAULT CHARSET=utf8;


-- -----------------------------------------------------
-- Table DIM_TIME
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS DIM_TIME (
  IDSK INT NOT NULL AUTO_INCREMENT,
  DATE DATE NOT NULL,
  DAY CHAR(2) NOT NULL,
  DAYWEEK VARCHAR(10) NOT NULL,
  MONTH CHAR(2) NOT NULL,
  NAMEMONTH VARCHAR(20) NOT NULL,
  QUARTER TINYINT NOT NULL,
  NAMEQUARTER VARCHAR(20) NOT NULL,
  YEAR CHAR(4) NOT NULL,
  SEASONYEAR VARCHAR(20) NOT NULL,
  WEEKEND VARCHAR(3) NOT NULL,
  COMPLETEDATE VARCHAR(10) NOT NULL,
  PRIMARY KEY (IDSK))
ENGINE = InnoDB DEFAULT CHARSET=utf8;


-- -----------------------------------------------------
-- Table FACT_SALE
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS FACT_SALE (
  ID_INVOICE INT NOT NULL,
  DIM_CUSTOMER_SK_CUSTOMER INT NOT NULL,
  DIM_BRAND_SK_BRAND INT NOT NULL,
  DIM_VENDER_SK_VENDER INT NOT NULL,
  DIM_CAR_SK_CAR INT NOT NULL,
  QUANTITY INT NOT NULL,
  TOTAL DECIMAL(10,2) NOT NULL,
  DIM_TIME_IDSK INT NOT NULL,
  PRIMARY KEY (ID_INVOICE, DIM_CUSTOMER_SK_CUSTOMER, DIM_BRAND_SK_BRAND, DIM_VENDER_SK_VENDER, DIM_CAR_SK_CAR, DIM_TIME_IDSK),
  
  CONSTRAINT fk_FACT_SALE_DIM_CUSTOMER
    FOREIGN KEY (DIM_CUSTOMER_SK_CUSTOMER)
    REFERENCES DIM_CUSTOMER (SK_CUSTOMER),
	
  CONSTRAINT fk_FACT_SALE_DIM_BRAND1
    FOREIGN KEY (DIM_BRAND_SK_BRAND)
    REFERENCES DIM_BRAND (SK_BRAND),
	
  CONSTRAINT fk_FACT_SALE_DIM_VENDER1
    FOREIGN KEY (DIM_VENDER_SK_VENDER)
    REFERENCES DIM_VENDER (SK_VENDER),
	
  CONSTRAINT fk_FACT_SALE_DIM_CAR1
    FOREIGN KEY (DIM_CAR_SK_CAR)
    REFERENCES DIM_CAR (SK_CAR),
	
  CONSTRAINT fk_FACT_SALE_DIM_TIME1
    FOREIGN KEY (DIM_TIME_IDSK)
    REFERENCES DIM_TIME (IDSK)
)
ENGINE = InnoDB DEFAULT CHARSET=utf8;






